const filterItems = (Item, setData) => {
    fetch("http://localhost:3001/cars.json")
      .then((res) => res.json())
      .then((data) => {
        const result = data.filter((curData) => {
          return curData.subcategory === Item;
        });
        setData(result);
      })
      .catch((error) => {
        console.error("Error fetching car.json:", error);
      });
  };
